import axios from 'axios';
import React, {useEffect, useState} from 'react'
import { Link } from 'react-router-dom'
import { Baseurl } from '../../baseurl';
import { useLocation } from 'react-router';

const CreatedCourses = () => {
    const [section, setSection] = useState([])
    const path = useLocation();

    useEffect(() => {
        let token = sessionStorage.Token
        if(token){
           axios.get(`${Baseurl}createdcourse`, {
                params: {
                    token: token
                }
            }).then((res) => {
                if (res.data) {
                    setSection(res.data)
                    
                }
            }).catch((error) => {
                if (error.response.status === 500) {
                    sessionStorage.setItem('Path', path.pathname)
                }
            })
        }else{

        }

    }, [])
    return (
        <>
          <section className="about container-fluid mt-4 mx-auto" id="about">
                <div class="row">
                    <div className='col-md-6 col-sm mx-auto text-center mt-4'>
                        <h5>Your have no courses</h5>
                        <i class="fas fa-books text-danger fa-3x"></i>
                        <Link to='/available-courses'><button class="btn d-flex mx-auto" type="submit" ><b>Create a Course</b></button></Link>
                    </div>

                    <small><strong>Created Courses</strong></small>
                    <div class="col-md-4 mt-2" data-aos="fade-in" data-aos-delay="100">
                        <div class="card p-3 mb-2 shadow" style={{ borderRadius: '20px' }} >
                            <div class="d-flex justify-content-between">
                                <div class="d-flex flex-row align-items-center">
                                    <div class="icon">  <i class="fab fa-html5 fa-2x" style={{ color: '#ffbb2c' }}></i> </div>
                                    <div class="ms-2 c-details">
                                        <h6 class="mb-0">Tutor</h6> <span>1 days ago</span>
                                    </div>
                                </div>
                                <div class="badge"> <span style={{ color: '#FFFFFF', backgroundColor: '#F75B00' }}>Bought</span> </div>
                            </div>
                            <div class="mt-2">
                                <h6 class="heading">Senior Product<br />Designer-Singapore</h6>
                                <div class="mt-2">
                                    <i class="bi bi-star" style={{ color: '#071B4D' }}></i> <i class="bi bi-star" style={{ color: '#071B4D' }}></i> <i class="bi bi-star" style={{ color: '#071B4D' }}></i> <i class="bi bi-star" style={{ color: '#071B4D' }}></i>
                                    <div class="mt-3"> <span class="text2"><strong><i class="fad fa-cart-plus"></i> Add to Cart</strong></span> </div>  </div>
                            </div>
                        </div>
                    </div>
                   
                    <div class="col-md-4 mt-2" data-aos="fade-in" data-aos-delay="100">
                        <div class="card p-3 mb-2 shadow" style={{ borderRadius: '20px' }} >
                            <div class="d-flex justify-content-between">
                                <div class="d-flex flex-row align-items-center">
                                    <div class="icon">              <i class="fab fa-bootstrap fa-2x" style={{ color: "#11dbcf" }}></i> </div>
                                    <div class="ms-2 c-details">
                                        <h6 class="mb-0">Tutor</h6> <span>1 days ago</span>
                                    </div>
                                </div>
                                <div class="badge"> <span style={{ color: '#FFFFFF', backgroundColor: '#F75B00' }}>Suggest</span> </div>
                            </div>
                            <div class="mt-2">
                                <h6 class="heading">Senior Product<br />Designer-Singapore</h6>
                                <div class="mt-2">
                                    <i class="bi bi-star" style={{ color: '#071B4D' }}></i> <i class="bi bi-star" style={{ color: '#071B4D' }}></i> <i class="bi bi-star" style={{ color: '#071B4D' }}></i> <i class="bi bi-star" style={{ color: '#071B4D' }}></i>
                                    <div class="mt-3"> <span class="text2"><strong><i class="fad fa-cart-plus"></i> Add to Cart</strong></span> </div>  </div>
                            </div>
                        </div>
                    </div>
                </div>

            </section>   
        </>
    )
}

export default CreatedCourses
